import React, { useState, useRef, useMemo, useCallback, useEffect } from 'react';
import { Canvas, useFrame } from '@react-three/fiber';
import { OrbitControls, Environment } from '@react-three/drei';
import * as THREE from 'three';

// Special logging function for rotation tracking
const logRotationStep = (step, face, direction, data = null) => {
  const timestamp = new Date().toLocaleTimeString();
  const message = `🔄 ROTATION STEP ${step}: ${face} ${direction}`;
  logToTerminal(message, data, 'INFO');
};

// Enhanced logging function that will be visible in terminal
const logToTerminal = (message, data = null, type = 'INFO') => {
  const timestamp = new Date().toLocaleTimeString();
  const prefix = type === 'ERROR' ? '❌' : type === 'WARNING' ? '⚠️' : type === 'SUCCESS' ? '✅' : '🎯';
  const fullMessage = `${prefix} [${timestamp}] ${message}`;
  
  // Create a more structured log entry
  const logEntry = {
    timestamp: timestamp,
    type: type,
    message: message,
    data: data
  };
  
  // Log to browser console with enhanced formatting
  console.log(`\n${fullMessage}`);
  if (data) {
    if (typeof data === 'object') {
      console.log(JSON.stringify(data, null, 2));
    } else {
      console.log(data);
    }
  }
  console.log('='.repeat(80) + '\n');
  
  // Send to log server to print in terminal
  fetch('http://localhost:3001/log', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify(logEntry)
  })
  .then(response => {
    if (!response.ok) {
      throw new Error(`HTTP error! status: ${response.status}`);
    }
    console.log('✅ Log sent to terminal successfully');
  })
  .catch(error => {
    console.error('❌ Could not send log to terminal server:', error);
    console.log('💡 Make sure the log server is running with: npm run log-server');
  });
};

// Function to create unique shapes for each piece with different border colors per face
function createShapeWithFaceBorder(pieceId, size, faceIndex) {
  // Use the 6 standard Rubik's cube colors for borders
  const borderColors = [
    '#FFFFFF', // Face 0 (front) - White
    '#FF8C00', // Face 1 (back) - Orange  
    '#00FF00', // Face 2 (right) - Green
    '#DC143C', // Face 3 (left) - Red
    '#0000FF', // Face 4 (top) - Blue
    '#FFD700'  // Face 5 (bottom) - Yellow
  ];
  
  const borderColor = borderColors[faceIndex] || '#000000';

  const shapes = [
    // 0-4: Basic geometric shapes (Squares) with individual face border colors
    () => <group position={[0, 0, 0.012]}>
      <mesh><planeGeometry args={[size, size]} /><meshBasicMaterial color="red" /></mesh>
      <mesh position={[0, 0, 0.001]}><planeGeometry args={[size*0.95, size*0.95]} /><meshBasicMaterial color={borderColor} /></mesh>
      <mesh position={[0, 0, 0.002]}><planeGeometry args={[size*0.9, size*0.9]} /><meshBasicMaterial color="red" /></mesh>
    </group>, // Square
    () => <group position={[0, 0, 0.012]}>
      <mesh><planeGeometry args={[size, size]} /><meshBasicMaterial color="blue" /></mesh>
      <mesh position={[0, 0, 0.001]}><planeGeometry args={[size*0.95, size*0.95]} /><meshBasicMaterial color={borderColor} /></mesh>
      <mesh position={[0, 0, 0.002]}><planeGeometry args={[size*0.9, size*0.9]} /><meshBasicMaterial color="blue" /></mesh>
    </group>, // Square
    () => <group position={[0, 0, 0.012]}>
      <mesh><planeGeometry args={[size, size]} /><meshBasicMaterial color="green" /></mesh>
      <mesh position={[0, 0, 0.001]}><planeGeometry args={[size*0.95, size*0.95]} /><meshBasicMaterial color={borderColor} /></mesh>
      <mesh position={[0, 0, 0.002]}><planeGeometry args={[size*0.9, size*0.9]} /><meshBasicMaterial color="green" /></mesh>
    </group>, // Square
    () => <group position={[0, 0, 0.012]}>
      <mesh><planeGeometry args={[size, size]} /><meshBasicMaterial color="orange" /></mesh>
      <mesh position={[0, 0, 0.001]}><planeGeometry args={[size*0.95, size*0.95]} /><meshBasicMaterial color={borderColor} /></mesh>
      <mesh position={[0, 0, 0.002]}><planeGeometry args={[size*0.9, size*0.9]} /><meshBasicMaterial color="orange" /></mesh>
    </group>, // Square
    () => <group position={[0, 0, 0.012]}>
      <mesh><planeGeometry args={[size, size]} /><meshBasicMaterial color="purple" /></mesh>
      <mesh position={[0, 0, 0.001]}><planeGeometry args={[size*0.95, size*0.95]} /><meshBasicMaterial color={borderColor} /></mesh>
      <mesh position={[0, 0, 0.002]}><planeGeometry args={[size*0.9, size*0.9]} /><meshBasicMaterial color="purple" /></mesh>
    </group>, // Square

    // 5-9: Circles with individual face border colors
    () => <group position={[0, 0, 0.012]}>
      <mesh><circleGeometry args={[size/2, 32]} /><meshBasicMaterial color="red" /></mesh>
      <mesh position={[0, 0, 0.001]}><circleGeometry args={[size*0.45, 32]} /><meshBasicMaterial color={borderColor} /></mesh>
      <mesh position={[0, 0, 0.002]}><circleGeometry args={[size*0.4, 32]} /><meshBasicMaterial color="red" /></mesh>
    </group>, // Circle
    () => <group position={[0, 0, 0.012]}>
      <mesh><circleGeometry args={[size/2, 32]} /><meshBasicMaterial color="blue" /></mesh>
      <mesh position={[0, 0, 0.001]}><circleGeometry args={[size*0.45, 32]} /><meshBasicMaterial color={borderColor} /></mesh>
      <mesh position={[0, 0, 0.002]}><circleGeometry args={[size*0.4, 32]} /><meshBasicMaterial color="blue" /></mesh>
    </group>, // Circle
    () => <group position={[0, 0, 0.012]}>
      <mesh><circleGeometry args={[size/2, 32]} /><meshBasicMaterial color="green" /></mesh>
      <mesh position={[0, 0, 0.001]}><circleGeometry args={[size*0.45, 32]} /><meshBasicMaterial color={borderColor} /></mesh>
      <mesh position={[0, 0, 0.002]}><circleGeometry args={[size*0.4, 32]} /><meshBasicMaterial color="green" /></mesh>
    </group>, // Circle
    () => <group position={[0, 0, 0.012]}>
      <mesh><circleGeometry args={[size/2, 32]} /><meshBasicMaterial color="orange" /></mesh>
      <mesh position={[0, 0, 0.001]}><circleGeometry args={[size*0.45, 32]} /><meshBasicMaterial color={borderColor} /></mesh>
      <mesh position={[0, 0, 0.002]}><circleGeometry args={[size*0.4, 32]} /><meshBasicMaterial color="orange" /></mesh>
    </group>, // Circle
    () => <group position={[0, 0, 0.012]}>
      <mesh><circleGeometry args={[size/2, 32]} /><meshBasicMaterial color="yellow" /></mesh>
      <mesh position={[0, 0, 0.001]}><circleGeometry args={[size*0.45, 32]} /><meshBasicMaterial color={borderColor} /></mesh>
      <mesh position={[0, 0, 0.002]}><circleGeometry args={[size*0.4, 32]} /><meshBasicMaterial color="yellow" /></mesh>
    </group>, // Circle

    // 10-14: Triangles (flat cones to create triangle shapes) with individual face border colors
    () => <group position={[0, 0, 0.012]}>
      <mesh rotation={[Math.PI/2, 0, 0]}><coneGeometry args={[size/2, 0.01, 3]} /><meshBasicMaterial color="cyan" /></mesh>
      <mesh position={[0, 0, 0.001]} rotation={[Math.PI/2, 0, 0]}><coneGeometry args={[size*0.45, 0.01, 3]} /><meshBasicMaterial color={borderColor} /></mesh>
      <mesh position={[0, 0, 0.002]} rotation={[Math.PI/2, 0, 0]}><coneGeometry args={[size*0.4, 0.01, 3]} /><meshBasicMaterial color="cyan" /></mesh>
    </group>, // Triangle
    () => <group position={[0, 0, 0.012]}>
      <mesh rotation={[Math.PI/2, 0, 0]}><coneGeometry args={[size/2, 0.01, 3]} /><meshBasicMaterial color="magenta" /></mesh>
      <mesh position={[0, 0, 0.001]} rotation={[Math.PI/2, 0, 0]}><coneGeometry args={[size*0.45, 0.01, 3]} /><meshBasicMaterial color={borderColor} /></mesh>
      <mesh position={[0, 0, 0.002]} rotation={[Math.PI/2, 0, 0]}><coneGeometry args={[size*0.4, 0.01, 3]} /><meshBasicMaterial color="magenta" /></mesh>
    </group>, // Triangle
    () => <group position={[0, 0, 0.012]}>
      <mesh rotation={[Math.PI/2, 0, 0]}><coneGeometry args={[size/2, 0.01, 3]} /><meshBasicMaterial color="lime" /></mesh>
      <mesh position={[0, 0, 0.001]} rotation={[Math.PI/2, 0, 0]}><coneGeometry args={[size*0.45, 0.01, 3]} /><meshBasicMaterial color={borderColor} /></mesh>
      <mesh position={[0, 0, 0.002]} rotation={[Math.PI/2, 0, 0]}><coneGeometry args={[size*0.4, 0.01, 3]} /><meshBasicMaterial color="lime" /></mesh>
    </group>, // Triangle
    () => <group position={[0, 0, 0.012]}>
      <mesh rotation={[Math.PI/2, 0, 0]}><coneGeometry args={[size/2, 0.01, 3]} /><meshBasicMaterial color="pink" /></mesh>
      <mesh position={[0, 0, 0.001]} rotation={[Math.PI/2, 0, 0]}><coneGeometry args={[size*0.45, 0.01, 3]} /><meshBasicMaterial color={borderColor} /></mesh>
      <mesh position={[0, 0, 0.002]} rotation={[Math.PI/2, 0, 0]}><coneGeometry args={[size*0.4, 0.01, 3]} /><meshBasicMaterial color="pink" /></mesh>
    </group>, // Triangle
    () => <group position={[0, 0, 0.012]}>
      <mesh rotation={[0, 0, Math.PI/4]}><planeGeometry args={[size, size]} /><meshBasicMaterial color="purple" /></mesh>
      <mesh position={[0, 0, 0.001]} rotation={[0, 0, Math.PI/4]}><planeGeometry args={[size*0.95, size*0.95]} /><meshBasicMaterial color={borderColor} /></mesh>
